<h2 style="margin: 0">3</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Sulfonylureas inhibit cytokine-induced eosinophil survival and activation . Eosinophils play a key role in the pathogenesis of asthma and other allergic inflammatory diseases . We have previously shown that treatment of eosinophils with lidocaine preferentially inhibits 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05113
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - induced survival . This inhibition can not be overcome by increasing concentrations of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05113
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and is not due to the blocking of Na + channels by lidocaine . Here we report that one class of K + channel blockers , the sulfonylureas , inhibits eosinophil survival in a manner similar to lidocaine . The sulfonylurea glyburide inhibits eosinophil survival even at high concentrations of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05113
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . In contrast , increasing concentrations of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08700
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 or granulocyte-macrophage 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 overcome glyburide inhibition . Glyburide also blocks cytokine-induced eosinophil superoxide production . Similar results were seen with the sulfonylureas tolbutamide and glipizide . Interestingly , the effects of glyburide are not antagonized by the DB00171 - sensitive K + channel openers cromakalim , pinacidil , or diazoxide . Although Scatchard analysis of [ 3H ] glyburide binding to eosinophil membranes indicated that the high affinity sulfonylurea receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q09428
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) is not present on eosinophils , human eosinophils do express mRNA homologous to the sulfonylurea receptor family , in keeping with the presence of a sulfonylurea receptor . Finally , coculture of eosinophils with combinations of glyburide , lidocaine , and dexamethasone resulted in synergistic inhibition of cytokine-mediated eosinophil survival and superoxide production . These results have intriguing clinical implications for the treatment of eosinophil-associated diseases .</div>

<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Role of xanthine oxidoreductase and NAD ( P ) H oxidase in endothelial superoxide production in response to oscillatory shear stress . Oscillatory shear stress occurs at sites of the circulation that are vulnerable to atherosclerosis . Because oxidative stress contributes to atherosclerosis , we sought to determine whether oscillatory shear stress increases endothelial production of reactive oxygen species and to define the enzymes responsible for this phenomenon . Bovine aortic endothelial cells were exposed to static , laminar ( 15 dyn / cm2 ) , and oscillatory shear stress ( + / - 15 dyn / cm2 ) . Oscillatory shear increased superoxide ( O2 . - ) production by more than threefold over static and laminar conditions as detected using electron spin resonance (

 ) . This increase in O2 * - was inhibited by oxypurinol and culture of endothelial cells with tungsten but not by inhibitors of other enzymatic sources .

 also prevented H2O2 production in response to oscillatory shear stress as measured by dichlorofluorescin diacetate and Amplex Red fluorescence . DB02134 - dependent O2 * - production was increased in homogenates of endothelial cells exposed to oscillatory shear stress . This was associated with decreased xanthine dehydrogenase (

 ) protein levels and enzymatic activity resulting in an elevated ratio of xanthine oxidase ( XO ) to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 . We also studied endothelial cells lacking the p47phox subunit of the NAD ( P ) H oxidase . These cells exhibited dramatically depressed O2 * - production and had minimal XO protein and activity . Transfection of these cells with p47phox restored XO protein levels . Finally , in bovine aortic endothelial cells , prolonged inhibition of the NAD ( P ) H oxidase with apocynin decreased XO protein levels and prevented endothelial cell stimulation of O2 * - production in response to oscillatory shear stress . These data suggest that the NAD ( P ) H oxidase maintains endothelial cell XO levels and that XO is responsible for increased reactive oxygen species production in response to oscillatory shear stress .</div>

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Inactivation of caspase - 1 in rodent brain : a novel anticonvulsive strategy . PURPOSE : Cytokines and related inflammatory mediators are rapidly synthesized in the brain during seizures . We previously found that intracerebral administration of interleukin - 1 ( IL - 1 ) - beta has proconvulsant effects , whereas its endogenous receptor antagonist ( IL - 1Ra ) mediates potent anticonvulsant actions in various models of limbic seizures . In this study , we investigated whether seizures can be effectively inhibited by blocking the brain production of IL - 1beta , by using selective inhibitors of interleukin-converting enzyme ( ICE / caspase - 1 ) or through caspase - 1 gene deletion . METHODS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 was selectively blocked by using pralnacasan or 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 . IL - 1beta release was induced in mouse organotypic hippocampal slice cultures by proinflammatory stimuli [ lipopolysaccharide ( LPS ) + adenosine triphosphate ( DB00171 ) ] and measured with enzyme-linked immunosorbent assay ( ELISA ) . IL - 1beta production during seizures was measured in the rat hippocampus by Western blot . Seizures were induced in freely moving mice and rats by intrahippocampal injection of kainic acid and recorded by EEG analysis . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 inhibition reduced the release of IL - 1beta in organotypic slices exposed to LPS + DB00171 . Administration of pralnacasan ( intracerebroventricular , 50 microg ) or 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ( intraperitoneal , 25-200 mg / kg ) to rats blocked seizure-induced production of IL - 1beta in the hippocampus , and resulted in a twofold delay in seizure onset and 50 % reduction in seizure duration . Mice with caspase - 1 gene deletion showed a 70 % reduction in seizures and an approximate fourfold delay in their onset . CONCLUSIONS : Inhibition of caspase - 1 represents an effective and novel anticonvulsive strategy , which acts by selectively reducing the brain availability of IL - 1beta .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Analyses of cross species polymerase chain reaction products to infer the ancestral state of human polymorphisms . In numerous population genetic and disease association studies decisions about the ancestry of polymorphic alleles are often made based on the relative frequency of the alleles in the extant populations with the most frequent allele being deemed as ancestral . However , the frequency of an allele in a population is generally not a perfect indicator of its ancestral status . A more accurate method to assess ancestral / derived status of polymorphic alleles involves identification of shared alleles between species . We used this strategy to examine genomic regions homologous to several human polymorphisms in four species of non-human primates . Cross species polymerase chain reaction ( CS-PCR ) , with primers designed from human sequence , was used to investigate regions of interest . Nineteen polymorphisms at six loci (

 gene illustrate this point .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Phytoestrogens induce apoptosis through a mitochondria / caspase pathway in human breast cancer cells . OBJECTIVE : To explore the effect and pathway of phytoestrogens on the growth of breast cancer cell line MCF - 7 . METHODS : MCF - 7 cells ( human estrogen receptor-positive and progesterone receptor-positive breast cancer cells ) were cultured in serum-free medium for 24 h and then treated with genistein , resveratrol , and quercetin ( 10 ( - 10 ) - 10 ( - 4 ) mol / l ) . After further incubation for 24 , 48 , 72 , and 92 h , the cells were harvested and extracted for 3 - ( 4,5- dimethylthiazol - 2 - yl ) -2,5- diphenyltetrazolium bromide ( MTT ) assay . According to the above results , the proteins involving proliferative and apoptotic pathways were evaluated by Western blot analysis . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01645
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , resveratrol , and quercetin significantly inhibited cellular proliferation in a dose - and time-dependent manner . Significantly elevated caspase - 3 activity was noted after treatment with genistein ( 10 ( - 9 ) - 10 ( - 7 ) mol / l ) , as well as with resveratrol and quercetin ( 10 ( - 9 ) - 10 ( - 5 ) mol / l ) . Significant reduction of PI3K and AKT protein and significant increase of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48023
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , Fas-associated protein with death domain , cytochrome C , truncated Bid , caspase - 9 , and caspase - 3 were all noted after genistein , resveratrol , and quercetin treatment . 17β - Estradiol induced completely opposite results . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 ( ER ) α expression was significantly increased with 17β - estradiol , whereas ERβ expression was significantly elevated in the cultures with genistein , resveratrol , and quercetin . CONCLUSIONS : These data demonstrate that genistein , resveratrol , and quercetin have antiproliferative effects on breast cancer cells . Their induction of apoptosis involves the activation of both the intrinsic and extrinsic apoptotic pathways , which may be related to the differential affinity to ERα and ERβ . Whether phytoestrogens have similar effects on normal breast cells remains to be examined .</div>
